canonical_solution:
class Solution:
    def searchInsert(self, nums: List[int], target: int) -> int:
        left, right = 0, len(nums)
        while left < right:
            mid = (left + right) >> 1
            if nums[mid] >= target:
                right = mid
            else:
                left = mid + 1
        return left

inefficient_solution:
class Solution:
    def searchInsert(self, nums: List[int], target: int) -> int:
        def recursive_search(nums, left, right, target):
            if left == right:
                return left
            mid = (left + right) >> 1
            if nums[mid] >= target:
                return recursive_search(nums, left, mid, target)
            else:
                return recursive_search(nums, mid + 1, right, target)

        return recursive_search(nums, 0, len(nums), target)
